import React, { useEffect } from 'react'
import { ArrowLeft } from 'react-bootstrap-icons'
import { Link } from 'react-router-dom'
import GallerySpace from '../Utilities/GallerySpace'
import Gods_Alternative_to_Bloodshed_2013 from "../Utilities/GodsAlternativetoBloodshed2013Gallery"
import Footer from './Footer'
import tournament from '../Utilities/ImageDirectories/16TeamsPhotos.json'


function Gallery() {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <div className=''>
      <div className='w-screen h-16 bg-white fixed p-4 opacity-100 z-10'>
            <Link to={'/homepage'} className='z-10'><ArrowLeft className='w-8 h-8'/></Link>
        </div>
      <div><GallerySpace title={"God's Vineyard Gospel Tournament 2024"} id={"tournament"} ImagesPath={tournament}/></div>
      <div>
        <Gods_Alternative_to_Bloodshed_2013 id={'godsalternativetobloodsheed2013'} title={"God's Alternative to Bloodshed 2013"}/>
      </div>
    </div>
  )
}

export default Gallery
